import React, { useState } from "react"
import Form from "../containers/Form"

const SignUpLogin = () => {
  const [alreadyMember, setAlreadyMember] = useState(false)

  return (
    <div>{alreadyMember ? <Form type="login" /> : <Form type="sign-up" />}</div>
  )
}

export default SignUpLogin
